

func totalHammingDistance(nums []int) int {

    // 從 1-bits 產生 N-bits 對應 bit on count
    
    bbs := []int{0}
    leng := 0
    
    for N:=0; N<16; N++ {
        leng = len(bbs)
        for z:=0; z<leng; z++ {
            bbs = append( bbs, bbs[z]+1 )
        }
        
        //fmt.Println( bbs )
    }
    
    leng = len(nums)-1
    y := 0
    diff := 0
    total := 0
    
    for x:=0; x<leng; x++ {
        X := nums[x]
        
        for y=x+1; y<len(nums); y++ {

            diff = X ^ nums[y]
            total += (bbs[diff&0xFFFF]) + (bbs[diff>>16])
        }
    }
    
    return total
}

